import React from 'react';


function video () {
    return (
        <video className="video" autoPlay loop>
            <source src="video.mp4"></source>
        </video>
    )
}

function Grid () {
    return (
        <>
            <div className="grid">
                
            </div>
        </>
    )
}

let Data = [];

for (let i = 0; i < 90; i++) {
    Data[i] = Math.floor ((Math.random * 3) +1 );
}

console.log(Math.floor ((Math.random * 3) +1 ))

export default video;
export {Grid};
